var loadAB = function() {
    var ABFunc = require('../common/main/load-ab');

    var options = {};
    require('../common/main/options-cache')(options);

    var optionsCache = [];
    var availableWidgets = [];
    for (var p in options) {
        if (options.hasOwnProperty(p)) {
            if(intuit.ius[p]) {

                availableWidgets.push({
                    widgetName: p,
                    obj : intuit.ius[p],
                    setup: intuit.ius[p].setup
                });


                // set the intuit.ius[widgetName].setup to a fake function that will only record the opts for later invocation
                intuit.ius[p] = function() {

                    var setup = function(opts) {
                        optionsCache.push({
                            name: this.widgetName,
                            options: opts
                        });
                    }

                    return {
                        setup: setup,
                        widgetName: p
                    }
                }();
            }
        }
    }

    var initWidgets = function() {

        // restore real function back to intuit.ius[widgetName].setup
        for(var i = 0,  j = availableWidgets.length; i < j; i++) {
            var widgetName = availableWidgets[i].widgetName;
            intuit.ius[widgetName] = availableWidgets[i];
        }


        // real invocation of .setup here
        for(var i = 0, j = optionsCache.length; i < j; i++) {
            var widgetName = optionsCache[i].name;
            var options = optionsCache[i].options;
            intuit.ius[widgetName].setup(options);
        }

        // setup is called, so config and init is populated now, restore config and init to the global widget obj
        for(var i = 0,  j = availableWidgets.length; i < j; i++) {
            var widgetName = availableWidgets[i].widgetName;
            intuit.ius[widgetName].config = availableWidgets[i].obj.config;
            intuit.ius[widgetName].init = availableWidgets[i].obj.init;
        }

        intuit.ius.jQuery("body").trigger('iusWidgetScriptsLoaded');
    }

    ABFunc(initWidgets, intuit.ius.jQuery);
}();

